    <script>
        $(document).ready(function(){
            $("path").click(function(){
                var municipio=$(this).attr("data-original-title");
                var id_municipio='todos';
                $("#municipio-seleccionado").text("Municipio seleccionado: "+municipio);
                $("#municipio option").each(function(){
                    if(municipio == $(this).text()){
                       $(this).attr('selected','selected'); 
                       id_municipio=$(this).val();
                    }
                });
                if(id_municipio=='todos'){
                    $('.institucion').show('slow');
                }else if(id_municipio=='ninguno'){
                    $('.institucion').hide('slow');
                }else{
                    $('.institucion').each(function(){
                        var municipioInstitucion=$(this).find('.municipio-institucion').text();
                        if(municipioInstitucion==id_municipio){
                            $(this).show('slow');
                        }else{
                            $(this).hide('slow');
                        }
                    });
                }
            });
            
            $("path").mouseover(function(){
                $(this).tooltip('show');
            });
            
        
            $('#municipio').change(function(){
                var municipio=$(this).val();
                if(municipio=='todos'){
                    $('.institucion').show('slow');
                }else if(municipio=='ninguno'){
                    $('.institucion').hide('slow');
                }else{
                    $('.institucion').each(function(){
                        var municipioInstitucion=$(this).find('.municipio-institucion').text();
                        if(municipioInstitucion==municipio){
                            $(this).show('slow');
                        }else{
                            $(this).hide('slow');
                        }
                    });
                }
                
            });
                $("#estado-seleccionado").text("Estado Seleccionado:"+$(this).attr('id'));
                $("#municipio").html('<option value="ninguno">Ninguno</option><option value="todos">Todos</option><option id="municipios-spinner">Cargando lista de Municipio ...</option>');
                $.getJSON('https://semsys.sev.gob.mx/ApiGlobal/ApiGeneral/contec/GetAllMunicipio', function(data){
                    data.forEach(function(dato){
                        $("#municipio").append('<option value="'+dato['Id_Municipio']+'">'+dato['Nombre']+'</option>');
                    });             
                })
                .done(function(){
                    $("#municipios-spinner").remove();
                });                
            $('path').mouseover(function(){
                $(this).attr('fill','#CCAC00');
            });
            $('path').mouseout(function(){
                $(this).attr('fill','#eee');
            });
        
            $("#buscador").keyup(function(){
                var buscar=$(this).val().toLowerCase();
                $(".nombre-institucion").each(function(){
                    var nombre= $(this).text().toLowerCase();
                    if(buscar.length==0 || nombre.indexOf(buscar)>-1){
                        $(this).parents('.institucion').show();
                    }else{
                        $(this).parents('.institucion').hide()
                    }
                });
            });
            
            $(".institucion").each(function(){
                var subsistema_id=$(this).attr("id");
                $.getJSON('https://semsys.sev.gob.mx/ApiGlobal/ApiGeneral/contec/GetIdSubsistema/'+subsistema_id, function(data){
                   $("#nombre_"+subsistema_id).text(data[0].Nombre);
                   $("#municipio_"+subsistema_id).text(data[0].Municipio);  
                   $("#resena_"+subsistema_id).text(data[0].Reseña);
                   $("#web_"+subsistema_id).attr('href',data[0].PaginaWeb);
                   $("#web_"+subsistema_id).text(data[0].PaginaWeb);
                   $("#whats_"+subsistema_id).text(data[0].Whatsapp);
                   $("#mail_"+subsistema_id).text(data[0].Correo);
                });
               
            });
            $(".servicios").click(function (){
                var uni_id=$(this).attr("id");
                $.getJSON('/universidades/servicios/'+uni_id, function(data){
                    $("#oferta").html("");
                    var cadena="";
                    data.forEach(function(dato,index){
                        cadena+='<tr><td>'+(index+1)+'</td><td>'+dato.oferta+'</td><td>'+dato.type+'</td><td>'+dato.name+'</td></tr>';
                    }); 
                    $("#oferta").html(cadena);
                });
            });
        });
    </script>
@endsection   